import logo from './logo.svg';
import './App.css';

import Login from './components/Login';

import { BrowserRouter, Route, Routes } from "react-router-dom";

function App() {
  return (
    <div className="App">
       <NextUIProvider>
      <BrowserRouter>
        <div>
          <Routes>
            <Route path="/" element={<Login></Login>} />

          </Routes>
        </div>
      </BrowserRouter>
    </NextUIProvider>
    </div>
  );
}

export default App;
